def find_path(maze, start, end):
    # Definiamo le direzioni di spostamento: 'g' per destra, 't' per sinistra, 'h' per gi, 'f' per su
    directions = {'g': (1, 0), 't': (-1, 0), 'h': (0, 1), 'f': (0, -1)}

    # Crea una coda per la BFS con il punto di partenza e il percorso per raggiungerlo
    queue = deque([(start, "")])
    visited = set()
    visited.add(start)

    while queue:
        current, path = queue.popleft()

        if current == end:
            return path

        x, y = current

        for direction, (dx, dy) in directions.items():
            next_pos = (x + dx, y + dy)

            # Controlla se la prossima posizione  all'interno del labirinto e non  un muro
            if next_pos not in visited and next_pos not in maze:
                visited.add(next_pos)
                queue.append((next_pos, path + direction))

    # Se non  possibile raggiungere la destinazione
    return None

def process_hex_list(hex_list):
    result = []
    x_sum = 0
    y_sum = 0

    for i, value in enumerate(hex_list):
        # Somma i primi 4 valori nella parte superiore
        if i % 8 < 4:
            x_sum += value
        else:
            # Somma gli ultimi 4 valori nella parte inferiore
            y_sum += value
        
        # Ogni 8 valori, aggiungi la coppia (x_sum, y_sum) all'array risultante
        if (i + 1) % 8 == 0:
            result.append((x_sum, y_sum))
            # Resetta le somme per il prossimo gruppo di 8 valori
            x_sum = 0
            y_sum = 0

    return result


